import React from 'react'
import $ from "jquery";



export default function Card1({ row, col, flipped, matched, value }) {
    return <div className="card1" row={row} col={col} flipped={flipped} matched={matched} >
            <img id='view' src={value} alt='card' />
        </div>
}

$('img').click(function(){
    $('#view').css('opacity', '1');
});
